import React, { Component } from 'react';
import goodIcon from '../../../../assets/good_status.png'
import badIcon from '../../../../assets/bad_status.png'
import './styles.css';

class PlaceViewer extends Component {
	state = { 
		location:  this.props?.location
	}
	render() { 
		const { location } = this.props?.location;
		return (
			<div id="PlaceViewerWrapper">		
				<div id="PlaceViewrHeader">
					<h2>{location?.name}</h2>
						{location?.isAvaliable ? <img src={goodIcon}/> : <img img={badIcon}/>}
				</div>
				<div id="PlaceOverviewWrapper">
					<div id="PhotoWrapper">
							<img/>
					</div>
					<div id="OccupanyWrapper">
							<h3> Occupany Limit: {location.occupany} </h3>
							<h4> Current occupany: {location.occupany} </h4>
					</div>
				</div>
				<div id="PlaceDetailsWapper">
					<div id="PlaceDescWrapper">

					</div>
				</div>
			</div>
		);
	}
}

export default PlaceViewer;
